def _cython_agg_blocks(self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1) -> Tuple[List[Block], Index]:
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    if how in ['mean', 'median', 'var']:
        if how == 'mean':
            result = data.mean()
        elif how == 'median':
            result = data.median()
        elif how == 'var':
            result = data.var()

        # Create a new block from the aggregation result
        agg_block = make_block(result.values, result.index, result.columns)

        # Form the new items and aggregate blocks
        new_items = [data.items]*len(result.columns)
        agg_blocks = [agg_block]*len(result.columns)

        return agg_blocks, new_items
    else:
        raise ValueError("Unsupported aggregation function: " + how)
